// Initialisation du script
function init() {
	// On cherche le noeud du tableau à partir duquel on va faire l'extension de tableau
	var nodesTh = document.getElementsByTagName('th');
	for (var i = 0; i < nodesTh.length; i++) {
		  var node = nodesTh[i];
		  
		  if (node.firstChild != null) {
			  // On prend le noeud dont la node enfant contient le mot clé "COMMERCE"
			  if (node.firstChild.nodeValue == "COMMERCE") {
				  thCommerce = node;
			  }
		  }
	}
	parentCommerce = thCommerce.parentNode;
	
	// TODO détecter quel type de page pour virer le style.
	
	
	// trouver le tr avec le nom du batiment.  Ajoute un bouton dans ce TR pour le déclenchement du script.
	buttonPosition = parentCommerce.parentNode.firstChild.firstChild; // c'est un TR donc on Descend dans son fils pour ajouter un bouton dans un td.
	buttonActive = addNode(buttonPosition, "input");
	buttonActive.type = 'button';
	buttonActive.value = 'Rentable ??';
	buttonActive.setAttribute('onclick', 'construction()');
	
	
}




function construction() {
	// Ajout des entêtes pour les nouvelles colonnes
	var node = addThNode(parentCommerce, thCommerce);
	addNodeText(node, "Cout prod")
	node = addThNode(parentCommerce, thCommerce);
	addNodeText(node, "Gain vente")
	node = addThNode(parentCommerce, thCommerce);
	addNodeText(node, "Gain revente")
	
	
	// Parcours des éléments du tableau du commerce
	cursor = parentCommerce.nextSibling; // On est sur les TR
	while (cursor != null) {
		
		var nbChild = cursor.childNodes.length;
		if (nbChild == 0) {
			// au cas où on tombe sur une node qui n'a pas d'enfant.
			cursor = cursor.nextSibling;
			continue;
		}
		
		var nodeName = cursor.childNodes[0].nodeName;
		var isTd = nodeName == 'TD';
		var isTh = nodeName == 'TH';
		
		if (nbChild == 2 && isTd) {
			// caisse deux child premier fils td
			traitementLigneCaisse(cursor);
		} else if (nbChild == 2 && isTh) {
			// catégorie 2 child premier = th
			traitementLigneCategorie(cursor);
		} else if (nbChild == 3) {
			// objet 3 child
			traitementLigneObjet(cursor);
		}
		// On passe au suivant
		cursor = cursor.nextSibling;
	}

	// Parcours les objets créé pour faire les liens de onchange.
	// Refaire des mécanismes de lisener. Reprendre carrément le code que j'ai déjà fait.
	

	// Déclenchement du premier calcul avec les données qui existe.
	
	
	// On retirer le bouton qui n'est plus utile.
	buttonPosition.removeChild(buttonActive);
} 



function traitementLigneCaisse(trCaisse) {
	// Si salaire on récupère le salaire et on met l'input.
	var td = trCaisse.childNodes[1];
	var fils = td.childNodes;
	
	var ii = fils.length - 1;
	if (ii <= 0) {
		return;
	}
	
	var chaineImpot = null;
	var nodeImpot = null;
	var nodeSalaire = null;
	var chaineSalaire = '';
	var baseImSal = 0;
	var baseSalaire = 10;
	
	if (fils[ii].nodeName == 'P') {
		chaineImpot = fils[ii].firstChild.nodeValue; 
		nodeImpot = fils[ii];
		// on redécale d'un cran c'est qu'on est dans les cas ou l'info sur l'impot est présente
		ii--;
		
		td.removeChild(nodeImpot);
	} 
	chaineSalaire = fils[ii].nodeValue;
	nodeSalaire = fils[ii];
	
	// SI pas null on récupère la valeur de l'impot sur le salaire
	if (chaineImpot != null) {
		//Impôt sur le salaire 5%
		var demDeb = {ch :'salaire', pos : 0};
		var demFin = {ch :'%', pos : 0};
		demDeb.pos = chaineImpot.indexOf(demDeb.ch) + demDeb.ch.length;
		demFin.pos = chaineImpot.indexOf(demFin.ch);
		baseImSal = parseInt(chaineImpot.substring(demDeb.pos, demFin.pos).trim());
	}
	

	// On va récupérer le salaire. 
	// : 3351 ÐE - Salaire : 50 ÐE/UT
	var demDeb = {ch :':', pos : 0};
	var demFin = {ch :'/UT', pos : 0};
	demDeb.pos = chaineSalaire.lastIndexOf(demDeb.ch) + demDeb.ch.length;
	demFin.pos = chaineSalaire.indexOf(demFin.ch)-2;
	
	baseSalaire = parseInt(chaineSalaire.substring(demDeb.pos, demFin.pos).trim());

	// remplace le texte du salaire par l'input
	nodeSalaire.nodeValue = chaineSalaire.substring(0, demDeb.pos); // debut
	addInputNode(td,'div_salaire', baseSalaire);
	addNodeText(td, ' ' + chaineSalaire.substring(demFin.pos))
	
	// on pose l'input pour le div des impot sur salaire
	var p = addNode(td, 'P');
	addNodeText(p,'Impôt sur le salaire ');
	addInputNode(p,'div_impot_salaire', baseImSal);
	addNodeText(p,'%');
}


function traitementLigneCategorie(trCategorie) {
	
	// valeur par défauts
	var nomImpot = '';
	var valeurImpot = 0;

	// TODO traitement de récupération des infos sur l'impot
	var td = trCategorie.childNodes[0];
	var chaineCat = td.firstChild.nodeValue;
	var pos = chaineCat.indexOf('(');
	if (pos == -1) {
		nomImpot = chaineCat.trim();
	} else {
		nomImpot = chaineCat.substring(0, pos-1).trim();
		// traitement base de l'impot
		
		var cValImpot = chaineCat.substring(pos);
		
		var demDeb = {ch :' ', pos : 0};
		var demFin = {ch :'%', pos : 0};
		demDeb.pos = cValImpot.lastIndexOf(demDeb.ch) + demDeb.ch.length;
		demFin.pos = cValImpot.indexOf(demFin.ch);
		valeurImpot = parseInt(cValImpot.substring(demDeb.pos, demFin.pos).trim());
		
		console.log(valeurImpot);
	}
	td.firstChild.nodeValue = nomImpot;

	// On enregistre l'impot dans le tableaux des impots.
	var cc = tabIdImpot.length;
	var idDiv = "div_impot_" + cc;
	tabIdImpot[cc] = {
		nom : nomImpot,
		value : valeurImpot,
		div : idDiv
	};

	
	var p = addNode(td, 'P');
	addNodeText(p,'Impôt vente ');
	addInputNode(p, idDiv, valeurImpot);
	addNodeText(p,'%');
}


